import React from 'react'
import './MenuItem.css'

function MenuItem({image, title}) {
    return (
        <div onClick={() => history.push(`/${title}`)} className="menuItem">
            {image ? <img src={image} alt=""/> : null}
            <span>{title}</span>
        </div>
    )
}

export default MenuItem
